// App.js 또는 원하는 React 컴포넌트에서
import React from 'react';
import './App.css'; // 스타일 파일을 불러옵니다

function App() {
  return (
    <div>
      {/* 풀스크린 배경 */}
      <div className="fullscreen-background"></div>

      {/* 그 위에 표시할 콘텐츠 */}
      <div className="content">
        <h1>Welcome to My Website</h1>
        <p>This is a React app with a fullscreen background image.</p>
      </div>
      <footer className="App-footer">
        &copy; 2024 My React App. All rights reserved.
      </footer>
    </div>
  );
}

export default App;
